import React from 'react';
import Card from './ProjectCard';

const aboutStyle = `
.about-container {
  margin-top: 100px;
}
`;

const About = () => {
  return (
    <div className="about-container">
      <h1>About Me</h1>
      {}
        <Card/>
      <style>{aboutStyle}</style>
    </div>
  );
};

export default About;
